def loaded_cable(f,a,b):
    return 75*(50+75*np.tanh((a+b*i)*f))/(75+50*np.tanh((a+b*i)*f))
def Reloaded_cable(f,a,b):
    y=loaded_cable(f,a,b)
    return y.real
def Imloaded_cable(f,a,b):
    y=loaded_cable(f,a,b)
    return y.imag

def LLloaded_cable(f,b):
    return 76*(50*np.cos(b*f)+76*i*np.sin(b*f))/(76*np.cos(b*f)+50*i*np.sin(b*f))
def LLReloaded_cable(f,b):
    y=LLloaded_cable(f,b)
    return y.real
def LLImloaded_cable(f,b):
    y=LLloaded_cable(f,b)
    return y.imag
